import React from 'react';
import { NavigationContainer } from '@react-navigation/native';
import { createStackNavigator } from '@react-navigation/stack';
import LoginScreen from './screens/LoginScreen';
import CadastroScreen from './screens/CadastroScreen';
import TarefaScreen from './screens/TarefaScreen';
import TarefaDetalhesScreen from './screens/TarefaDetalhesScreen';

const Stack = createStackNavigator();

const App = () => {
  return (
    <NavigationContainer>
      <Stack.Navigator>
        <Stack.Screen name="Login" component={LoginScreen} />
        <Stack.Screen name="Cadastro" component={CadastroScreen} />
        <Stack.Screen name="Tarefas" component={TarefaScreen} />
        <Stack.Screen name="Detalhes da Tarefa" component={TarefaDetalhesScreen} />
      </Stack.Navigator>
    </NavigationContainer>
  );
};

export default App;
